import styled from "styled-components";

const Container = styled.div`
  height: 30px;
  background-color: orange;
  color: black;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 14px;
  font-weight: 500;
`;

const Headline = () => {
  return (
    <Container>Amazing discount! 25% slash on all orders over N30k</Container>
  );
};

export default Headline;
